import { useEffect, useState } from 'react';
import './App.css';
import tmdb from './Tmdb'

function App() {

  const [movieList, setMovieList]= useState([])

  useEffect(()=>{
    const loadAll = async () =>{
      //pegando a lista total
      let list = await tmdb.getHomeList()
      setMovieList(list)
    }

    loadAll()
  },[])


  return (
    <div>
      <ul>
        movieList.map((item, key)=>{
          <li></li>
        })
      </ul>
    </div>
  );
}

export default App;
